} from "./styles";

const Navbar = () => {
  return (
    <NavbarStyled>
      <WrapperMenuAndLogo>
        <Menu>
          <MenuItem>BROWSE</MenuItem>
          <MenuItem>KIDS</MenuItem>
        </Menu>
      </WrapperMenuAndLogo>
    </NavbarStyled>
  );
};

export default Navbar;
